import { NavLink } from "react-router-dom";

interface navBarProps {
    isOnEditor: boolean
    updatePageState: (a: boolean) => void
}

const NavBar = (props: navBarProps) => {

    if (props.isOnEditor) {
        props.updatePageState(props.isOnEditor);
        return (
			<>
				<nav>
					<ul>
						<li>
							<NavLink to="/"> Back To Projects </NavLink>
						</li>
					</ul>
				</nav>
			</>
        ); 
    } else {
        return (
        <>
            <nav>
				<ul>
					<li>
						<NavLink to="/"> Projects </NavLink>
					</li>
					<li>
						<NavLink to="/recently-deleted"> Recently Deleted</NavLink>
					</li>
					<li>
						<NavLink to="/editor"> Editor</NavLink>
					</li>
				</ul>
            </nav>
            </>
        );

    }
};

export default NavBar
